import React from 'react'
import ReactPlayer from 'react-player'
import '../../App.css';


function Videos() {
    return (
        <div className="video-container">
             <div className="video-node1">

                <ReactPlayer url="https://youtu.be/vhpHheIBMpU" />

            </div>
        </div>
    )
}

export default Videos
